import React from "react";
import "./Caption.css";

export default function Caption() {
  return (
    <div className="Caption">
      <div className="Datagraph">
        <p>
          <i>
            <u> above:</u> visualization of computer vision word classification
            system{" "}
          </i>{" "}
        </p>
      </div>
      <br />
    </div>
  );
}
